function successMessage(e){Swal.fire("Successfully!",e,"success")}function errorMessage(e){Swal.fire({icon:"error",title:"Oops...",text:e,footer:'<a href="">Why do I have this issue?</a>'})}function confirmMessage(e){return Swal.fire({title:"Are you sure?",text:e,icon:"warning",showCancelButton:!0,confirmButtonColor:"#3085d6",cancelButtonColor:"#d33",confirmButtonText:"Yes, delete chat!"}).then(e=>{if(!e.isConfirmed)return null})}export{successMessage,errorMessage,confirmMessage};